import styled from 'styled-components'

export const StyledContentContainer = styled.div`
	height: 60rem;
	width: 70rem;
	max-width: 80%;
	margin: 0 auto;
	display: flex;
	flex-direction: column;
	gap: 4rem;

	 > h1 {
		margin-top: 5rem;
		font-weight: 600;
	}
`
